INSERT INTO `product_info` VALUES (1,'Domates yetiştiriciliği dünya çapında en çok gerçekleştirilen sebze üretimlerinin başında gelir. Diğer sebzeler ile karşılaştırıldığında nispeten daha zahmetsiz bir yetiştirilme sürecine sahip olan domates zengin içeriği sayesinde insan sağlığı için de oldukça faydalıdır. Eşsiz lezzeti ve ilgi çekici renkleri ile öne çıkan domates bitkisini bazı noktalara dikkat ederek kolay bir şekilde yetiştirebilirsiniz. Toprak konusunda çok seçici olmayan ve geniş bir sıcaklık aralığında yetişebilen domates bitkisi ülkemizde birden fazla alanda verimli bir şekilde yetiştirilir.\nDomates yetiştiriciliği konusu yaygın olarak merak edilir. Domates yetiştiriciliği gerekli şartlar sağlandığında oldukça kolaydır. Domates fidelerini toprağa şaşırtıktan sonra uygun gün ışığı, sıcaklığı ve nemi sağladıktan sonra gelişmesine ve meyve vermesine tanıklık edebilirsiniz. Toprak seçici (aşırı yüksek pH’lar, taban suyunun yüksek olduğu topraklar vb toprak yapıları hariç) bir bitki olmayan domatesin yetiştirilebilmesi için besin bakımından zengin toprak, uygun sıcaklık, uygun ışık miktarı ve bütün bunlara göre oluşturulmuş bir sulama düzeni yeterlidir. Ayrıca bölgelere göre çeşit seçimlerinin yapılması önem arz etmektedir. Aynı zamanda verimli bir domates üretimi için zirai mücadele, zararlılara karşı alınacak önlemler ve bitkinin gelişimi için kullanılacak besinlerin doğru zaman ve dozlarda kullanılmaları gerekmektedir. Domates yetiştiriciliğinde önem taşıyan bazı detaylara dikkat edilerek verimli bir hasat elde edilebilir.','Domates','../assets/images/domates.jpg'),(2,'Biber yemeklere aroma veren ve her mevsim sıklıkla tüketilen sebzeler arasındadır. Biber üretimi Türkiye’de ve dünyada yaygın olarak yapılır. Türkiye’nin farklı bölgelerinde biber tarımı mevcuttur. Tohum cinsine göre farklı çeşitlerde yetiştirilen biber türleri vardır. Kapya, sivri, çarliston, köy biberi, dolma biber gibi pek çok farklı çeşitte biber yetiştiriciliği yapılır. Peki biber yetiştirme koşulları nelerdir? Biber fidanı ne zaman dikilir ve hasat edilir? Biber yetiştiriciliğine dair merak ettiğiniz tüm detayları bu yazıda bulabilirsiniz.\nBiber yaz mevsiminde yetiştirilen bir sebzedir. Bu nedenle, hava sıcaklığına göre Türkiye’nin çeşitli bölgelerinde farklı zamanlarda dikilir. Biber sıcak iklimlerde çok yıllık, ılık bölgelerinde tek yıllık bir bitkidir. Dolayısıyla, ılık iklimlerde biber her yıl yeniden dikilirken sıcak bölgelerde her sene dikimi yapılmaz.\n\nBiber yetiştirilirken özellikle erken evrelerde fazla sıcaklığa gereksinim duyar. Açık alanlarda biber tarımı yapılması için hava sıcaklığının optimum 18 ile 26 derece arasında olmalıdır. Ancak sera yetiştiriciliğinde durum farklıdır. Seralar kapalı alanlar olduğu ve jeotermal ısıtma ile ısıtılabildiğinden hava sıcaklığından bağımsız olarak burada biber tarımı yapılır.\n\nBiber tarımı için erken dönemde, hava sıcaklığı yükseldiğinde tohum viyollere dikilerek fide yetiştirilir. Büyüyen fidelerin belirli aralıklarla ocak yapılarak ekilmesiyle biber tarımı gerçekleştirilir.','Biber','../assets/images/biber.jpg'),(3,'Fasulye ülkemizde uygun şartları olan her bölgede yetişir. Yetişmesi için gerekli olan şartlar az olduğu için yetiştirilme alanı çok geniştir. Fasulye baklagiller sınıfından bir bitkidir. Burada bu bitki hakkında oldukça geniş tutulmuş bir derleme yazı bulacaksınız.\nSonbaharda 20-25 cm derinlikte sürülen toprak, ilkbaharda diskaro ve tırmık gibi ikinci toprak işleme aletleriyle hazırlanır. Ekim ve çıkış öncesi kullanılabilen kimyasallar ile yabancı ot savaşı yapılabilir.\n\nÜlkemizde son yıllarda kuru fasulye tarımına uygun Şehirali-90(Horoz-Bodur), Yunus-90(Horoz-Bodur),Göynük -98(Horoz-Bodur), Akman-98(Dermason- Yan sarılıcı) gibi bazı çeşitler geliştirilmiştir.Buna karşın günümüzde hala populasyon karekterindeki yerel çeşitlerin tarımı yaygın bir şekilde yapılmaktadır.\n\nKuru fasulye üretimi için ekim, Orta Anadolu bölgemizde Nisan ayının son haftasından Mayıs ayı başlarına, Doğu Anadolu da Mayıs ayı ortalarından Haziran ayı başlarına kadar, kıyı bölgelerde Mart ayı içerisinde yapılmalıdır.','Taze Fasulye','../assets/images/fasulye.jpg'),(4,'Sonbaharda 20-25 cm derinlikte sürülen toprak, ilkbaharda diskaro ve tırmık gibi ikinci toprak işleme aletleriyle hazırlanır. Ekim ve çıkış öncesi kullanılabilen kimyasallar ile yabancı ot savaşı yapılabilir.\n\nÜlkemizde son yıllarda kuru fasulye tarımına uygun Şehirali-90(Horoz-Bodur), Yunus-90(Horoz-Bodur),Göynük -98(Horoz-Bodur), Akman-98(Dermason- Yan sarılıcı) gibi bazı çeşitler geliştirilmiştir.Buna karşın günümüzde hala populasyon karekterindeki yerel çeşitlerin tarımı yaygın bir şekilde yapılmaktadır.\n\nKuru fasulye üretimi için ekim, Orta Anadolu bölgemizde Nisan ayının son haftasından Mayıs ayı başlarına, Doğu Anadolu da Mayıs ayı ortalarından Haziran ayı başlarına kadar, kıyı bölgelerde Mart ayı içerisinde yapılmalıdır.','Arpa','../assets/images/arpa.jpg'),(5,'Buğday, dünyanın hemen her yerinde farklı formlarıyla en çok tüketilen besinlerin başında yer alır. Sofralarda tüketilen ekmekten bulgura kadar pek çok gıdanın ana unsurunu oluşturur. Bu nedenle doğru ve verimli bir şekilde yetiştirilmesi son derece önemlidir. Buğday, hemen her iklimde yetiştirilebilen bitki türleri arasında yer alır. Ancak buğday yetiştiriciliğinde dikkat edilmesi gereken bazı hususlar, ürünün hasadından alınacak verimi doğrudan etkileyebilir.\n\nBuğday yetiştiriciliği her yıl aralıksız devam eden bir süreçtir. Çiftçiler hem yerel hem de ulusal pazarda yoğun talebi karşılamak için buğday üretimine ara vermeden devam ederler. Ayrıca buğdayın ekim, hasat ve muhafaza kolaylığı da bulunur. Çiftçilerin buğday üretimi işine ağırlık vermelerinde bu kolaylıkların da etkisi vardır.\n\nBuğday yetiştiriciliğinde iklim, ekim yöntemleri, sulama teknikleri, gübreleme, hasat şekli gibi pek çok değişken etkilidir. Bu sebeple buğday tarımında maksimum faydanın sağlanabilmesi için tüm bu değişkenler hakkında tam ve doğru bilgiye sahip olmak gerekir. Sağlıklı, kaliteli ve maksimum verimde buğday elde edebilmek için ekim zamanı, ekim derinliği gibi kriterlerin yanı sıra ekilecek çeşidin seçimine dikkat edilmelidir. Bu bileşenler bazen toprak, bazen hava, bazen ise su kaynaklı olarak üretimi tehdit edebilir.','Buğday','../assets/images/buğday.jpg'),(6,'Ilıman iklimlerde yıllık, tropik iklimlerde ise çok yıllık bir bitki olma özelliği gösteren bamyalar, yüksek sıcaklıkta daha yüksek verim sağlıyor. 5-6 derece sıcaklığa kadar dayansa da verimi oldukça düşüyor. Gece sıcaklıkların düştüğü alanlarda düzenli ürün veremeyen, bodur kalan bitki, soğuklara karşı duyarlı görünüyor. Keza, yaz mevsiminin kısa olduğu yerlerde, özellikle bodur boylu ve erkenci çeşitler yetiştirilebiliyor. Ülkemizde, Akdeniz, Ege, Marmara ve Karadeniz bölgelerinde bamya yetiştiriciliği yapılıyor. \n\nSöz konusu toprak özellikleri olduğunda ise bamya tarımı pek seçici olmadığının altı çiziliyor. Her türlü toprakta rahatlıkla yetişen bamyalar için en ideal toprağın ise derin, geçirgen ve kumlu-tınlı olanlar olduğu belirtiliyor. Bamyanın özellikle ekim döneminde aşırı nemli toprak sevmediğinin üstünde duruluyor. Toprak pH’ının 5.0 ile 8.0 arasında olması bamya yetiştiriciliği için tavsiye ediliyor. ','Bamya','../assets/images/bamya.jpg'),(7,'Patates gübreleme işlemi, bitkinin büyümesi ve verimliliği için gereklidir. İyi bir gübreleme programı, bitkilerin tüm besin ihtiyaçlarını karşılayacak şekilde hazırlanmalıdır. Patatesler genellikle azot, fosfor ve potasyum gibi temel besin maddelerine ihtiyaç duyarlar. Bunların yanı sıra mikro besin elementlerine de ihtiyaç duyarlar (B, Mn, Mg gibi)\n\nPatateslerin sulama ihtiyacı da çok önemlidir. Bitkilerin suya ihtiyacı, büyüme aşamasına bağlı olarak değişir. Patateslerin su isteği, genellikle çiçeklenme dönemi ve hasat öncesi dönemde artar. Patateslerin kuraklık gibi stresli koşullar altında yetiştirilmesi, daha düşük verimlilik ve kaliteye neden olur.\n\nPatates sulama ihtiyacı, toprağın nem durumuna bağlıdır. Toprak nemini kontrol etmek için bir nem ölçer kullanılabilir. Bu cihazlar, bitkinin kök bölgesindeki nem seviyesini ölçerek, sulamanın ne zaman gerektiğini belirlemeye yardımcı olur.','Taze Patates','../assets/images/patates.jpg'),(8,'Soğan yetiştiriciliği üç farklı şekilde gerçekleştirilir. İlk yöntem doğrudan tohum ekimiyle başlar ve aynı vegetasyon dönemi içinde 5-6 aylık bir süreçte hasat edilir. İkinci yöntem olan arpacık ile yapılan yetiştiricilikte, ilk yıl arpacıklar elde edilir.  İkinci yıl bu arpacıklar ekilerek baş elde edilir. Üçüncü yöntem ise fideyle yapılan yetiştiriciliktir ve tohum ekimiyle aynı süreye sahiptir; ancak aynı yıl içinde baş elde edilir. Ekonomik açıdan en uygun yöntem doğrudan tohum ekimiyle olanıdır. Bu yöntemin başarıyla uygulanabilmesi için tarlada çok iyi bir toprak hazırlığı yapılması gerekir. Tarla, sonbaharda işlenir ve işlemeden önce dekara 2-4 ton yanmış ahır gübresi atılır. Akdeniz bölgesinde tohum ekim tarihi genellikle 15 Ağustos ile 15 Ekim arasındaki döneme denk gelir. Ekimden önce toprak tava gelir gelmez yüzlek işlenir. Toprak, kültivatör ve tırmıkla iyice parçalanır, ardından bastırılır ve tohumlar ekilir. Bitki sıra aralığı 20-30 cm olmalıdır ve bitkiler 10 cm yüksekliğe ulaştığında sıra üstü mesafeleri ayarlamak için elle seyreltme yapılır. ','Soğan ','../assets/images/soğan.jpg'),(9,'İlk can suyundan sonra 15-20 gün süreyle patlıcanlara su verilmemesi gerekiyor. \nİlk meyvelerden sonra belli aralıklarla su vermek önemli görülüyor. Özellikle hasat döneminde, her hasadın ardından sulamayı ihmal etmemelisiniz. Yetişme devresinde ise 7-8 günde bir sulama yapmalısınız. \nPatlıcan yetiştiriciliği için en uygun sulama yolunun damlama sulama olduğu biliniyor ancak ülkemizde hala masura usulü sulama yaygın kullanılıyor. \n\nPatlıcan Yetiştiriciliğinin Püf Noktaları Nelerdir?\n\nFideler şaşırtıldıktan sonra can suyu veriliyor. Dikim zamanı hava sıcaksa patlıcan fideleri ilk günlerde cansız görünüm sergiliyor. Çiftçilerimizin bu görünüme aldanmaması gerekiyor, tutan fideler ortalama 1 haftada canlanıyor. Tutmamış fidelerin yerine bu süre zarfında yenileri ekilebiliyor. \nDikimin 7-10 gün sonrasında birinci çapa, dikimden 20-30 gün sonra ikinci çapa yapılıyor. Patlıcan fideleri dallanıp boylandığında çapa sonlandırılıyor. ','Patlıcan','../assets/images/patlıcan.jpg'),(10,'Eğer ekim sırasında tohum sık atıldıysa çıkıştan yaklaşık 2 hafta sonra seyreltme işlemi uygulanmalıdır. Bu dönemde çıkan yabancı topraklar çok geçmeden çapalanmalı ve toprak sürekli olarak havalandırılmalıdır. Çapalama sırasında genç bitkilerin zarar görmemesine oldukça fazla dikkat edilmelidir.\n\nMısır bitkisine ikinci azotlu gübreyi de uygulamanızın ardından çapa vb. aletlerle boğaz doldurma işlemi yapılmalıdır. Destek köklerinin toprakla temasını sağlayabilmek için bu işlemin yapılması büyük önem taşımaktadır.\n\nTüm bunların yanında mısırın kendi etrafnda yetişen yabancı otlarla mücadele gücü zayıf olduğundan dolayı, serbest bırakılması halinde ihtiyacı olan su, ışık ve besinden mahrum kalabilir. Bu nedenle çeşitli kimyasal ot öldürücüler yardımıyla veya çapa gibi aletlerle mekanik olarak yabancı otlarla kesin olarak mücadele edilmelidir.','Mısır','../assets/images/mısır.jpg');
